import React, { useEffect, useState } from 'react'
import { useHistory } from 'react-router-dom';
import Header from '../partials/Header'

export default function Dashboard() {
      const [top, setTop] = useState(true);
      const [user,setUser] = useState()
      const his = useHistory()
      useEffect(() => {
            let storge = localStorage.getItem("user-info")
    setUser(storge)

    const scrollHandler = () => {
      window.pageYOffset > 10 ? setTop(false) : setTop(true)
    };
    window.addEventListener('scroll', scrollHandler);
    return () => window.removeEventListener('scroll', scrollHandler);

      }, [])

 const logout =()=>{
       localStorage.removeItem("user-info")
        his.push("/")
 }

      return (
            <div>
                  {
                        user ? 

                     <nav className="flex flex-grow">
                        <ul className="flex flex-grow justify-end flex-wrap items-center">
                          <li>
                            <div onClick={logout}  className="font-medium text-gray-600 hover:text-gray-900 px-5 py-3 flex items-center transition duration-150 ease-in-out">Logout</div>
                          </li>
                        </ul>
                      </nav>

                        :
                        <> 
                        <Header></Header>
                        <div >
                              <h1>You are not Loged In</h1>
                         </div>

                        </>


                  }

            </div>
      )
}
